import React from 'react'
import './DownloadIcon.css'
import { FiDownload } from 'react-icons/fi';


function DownloadIcon() {
    return (
        <div className='downloadIcon'>
            <FiDownload className='downloadIcon_icon' />
        </div>
    )
}

export default DownloadIcon
